import axios from 'axios';

//מחזירה את המכירות שלא אושרו של המשתמש שנשלח
export const getUnapprovedAuctionsByUserFromDB = (user_id) => {
    return axios.get(`http://localhost:5000/auctions/getUnapprovedAuctionsByUser/${user_id}`);
}


export const getBestSellingProductByAuctionFromDB = (_id) => {
    return axios.get(`hhtp://localhost:5000/auctions/getBestSellingProductByAuction/${_id}`)
}

export const getTotalRevenueFromDB = (_id) => {
    return axios.get(`hhtp://localhost:5000/auctions/getTotalRevenue/${_id}`)
}
